import React from "react";
import { useScroll } from "./utils";
import { Header, Landing, Introduction, AboutPartner, Footer, OrderItem, } from './components';
import ByeAndSell from "./components/ByeAndSell";
import SignIn from "./SignIn/SignIn";
import SignUp from "./SignUp/SignUp";
import SubCategories from "./SubCategories/SubCategories";
import PlaceAd from "./PlaceAd/PlaceAd";
import AllAd from "./AllAd/AllAd";
import ActiveAd from "./ActiveAd/ActiveAd";
import Bids from "./Bids/Bids";
import ExpiredAd from "./ExpiredAd/ExpiredAd";
import SoldAd from "./SoldAd/SoldAd";
import Payment from "./Payments/Payments";
import Settings from "./Settings/Settings";
import Chat from "./Chat/Chat";
import SavedAds from "./SavedAds/SavedAds";
import SavedSearches from "./SavedSearches/SavedSearches";
import ForgotPassword from "./ForgotPassword/ForgotPassword";
import Page404 from "./Page404/Page404";
import UnderConstruction from "./UnderConstruction/UnderConstruction";
import Subscription from "./Subscription/Subscription";
import ProductPage from "./ProductPage/ProductPage";
import ProductOverview from "./ProductOverview/ProductOverview";
import HomePage5 from "./HomePage5/HomePage5";
import {
  BrowserRouter,
  Routes,
  Route,
  Link,
  Outlet
} from 'react-router-dom';
import Cookise from "./Cookies/Cookies";
import BrowseByMake from "./BrowseByMake/BrowseByMake";
import BrowseByBody from "./BrowseByBody/BrowseByBody";
import LoggedIn from "./LoggedIn/LoggedIn";
import EditProfile from "./EditProfile/EditProfile";
import EndingSoon from "./EndingSoon/EndingSoon";
import LatestMotors from "./LatestMotors/LatestMotors";
import Profile from "./Profile/Profile";
import Profile_2 from "./Profile_2/Profile_2";
import Profile_3 from "./Profile_3/Profile_3";
import PlaceABid from "./PlaceABid/PlaceABid";
import Message from "./Message/Message";
import Message_1 from "./Message_1/Message_1";
import Convertible from "./BrowseByBody/Convertible";
import Coupe from "./BrowseByBody/Coupe";
import Pickups from "./BrowseByBody/Pickups";
import SportsCars from "./BrowseByBody/SportsCars";
import Hatchback from "./BrowseByBody/Hatchback";
import Minivan from "./BrowseByBody/Minivan";
import Sedan from "./BrowseByBody/Sedan";
import SUV from "./BrowseByBody/SUV";
import PetsProductPage from "./PetsProductPage /PetsProductPage ";
import HomeProductPage from "./HomeProductPage /HomeProductPage ";


function App() {
  const [scrollToContent, contentRef] = useScroll()

  return (
    <div className="box-border">
      <Header />
      <BrowserRouter>
        <Routes>


          <Route path="/" element={<LoggedIn />} />
          <Route path="/home" element={<HomePage5 />} />
          <Route path="/SignIn" element={<SignIn />} />
          <Route path="/SignUp" element={<SignUp />} />
          <Route path="/Cookise" element={<Cookise />} />
          <Route path="/advertisement" element={<PlaceAd />} />
          <Route path="/product_page" element={<ProductPage />} />
          <Route path="/product_overview" element={<ProductOverview />} />
          <Route path="/expired_ad" element={<ExpiredAd />} />
          <Route path="/chat" element={<Chat />} />
          <Route path="/saved_ads" element={<SavedAds />} />
          <Route path="/all_ad" element={<AllAd />} />
          <Route path="/active_ad" element={<ActiveAd />} />
          <Route path="/bids" element={<Bids />} />
          <Route path="/sold_ad" element={<SoldAd />} />
          <Route path="/saved_searches" element={<SavedSearches />} />
          <Route path="/page404" element={<Page404 />} />
          <Route path="/browse_by_make" element={<BrowseByMake />} />
          <Route path="/browse_by_body" element={<BrowseByBody />} />
          <Route path="/under_construction" element={<UnderConstruction />} />
          <Route path="/payment" element={<Payment />} />
          <Route path="/edit_profile" element={<EditProfile />} />
          <Route path="/ending_soon" element={<EndingSoon />} />
          <Route path="/latest_motors" element={<LatestMotors />} />
          <Route path="/profile_1" element={<Profile />} />
